import Distribution from './Distribution';
import React, {Component} from 'react'; 

class Geometrica extends Distribution {
    constructor () {
      super();
      this.name = "Geométrica";
    }

    render(){
      return(
        <div> {this.name} </div>
      )
    }
}

export default Geometrica;
